import React, { useState } from 'react';
import './BurgerMenu.css';

const BurgerMenu = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="burger-menu" onClick={toggleMenu}>
      {isOpen ? (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 24 24"
          className="close-icon"
        >
          <line x1="6" y1="6" x2="18" y2="18" className="line" />
          <line x1="6" y1="18" x2="18" y2="6" className="line" />
        </svg>
      ) : (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 24 24"
          className="burger-icon"
        >
          <line x1="2" y1="6" x2="22" y2="6" className="line" />
          <line x1="2" y1="12" x2="22" y2="12" className="line" />
          <line x1="2" y1="18" x2="22" y2="18" className="line" />
        </svg>
      )}
    </div>
  );
};

export default BurgerMenu;
